import { NavLink } from "react-router-dom";
import { Calculator, History, User } from "lucide-react";

export default function BottomNav() {
  return (
    <nav className="bottom-nav">
      <NavLink to="/" end>
        <Calculator />
        <span>Калькулятор</span>
      </NavLink>

      <NavLink to="/history">
        <History />
        <span>История</span>
      </NavLink>

      <NavLink to="/profile">
        <User />
        <span>Профиль</span>
      </NavLink>
    </nav>
  );
}
